create database airports_dev;

--Use airports_dev -> new database connection with airports_dev -> open SQL Editor in airports_dev - Execute thw following SQL Statements:

CREATE TABLE public.airlines (
    id bigint NOT NULL,
    active boolean,
    alias character varying(255),
    callsign character varying(255),
    country character varying(255),
    iata character varying(2),
    icao character varying(3),
    name character varying(255)
);

ALTER TABLE public.airlines ALTER COLUMN id ADD GENERATED BY DEFAULT AS IDENTITY (
    SEQUENCE NAME public.airlines_id_seq
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1
);


CREATE TABLE public.airports (
    id bigint NOT NULL,
    altitude integer,
    city character varying(255),
    country character varying(255),
    dst character(1),
    iata character varying(3),
    icao character varying(4),
    latitude numeric(19,2),
    longitude numeric(19,2),
    name character varying(255),
    source character varying(255),
    timezone double precision,
    type character varying(255),
    tz character varying(255)
);
ALTER TABLE public.airports ALTER COLUMN id ADD GENERATED BY DEFAULT AS IDENTITY (
    SEQUENCE NAME public.airports_id_seq
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1
);
	 
CREATE TABLE public.flights (
    id bigint NOT NULL,
    arrival_time timestamp without time zone,
    departure_time timestamp without time zone,
    flight_no character varying(255),
    arrival_airport_id bigint NOT NULL,
    departure_airport_id bigint NOT NULL,
    airline_id bigint NOT NULL
);
ALTER TABLE public.flights ALTER COLUMN id ADD GENERATED BY DEFAULT AS IDENTITY (
    SEQUENCE NAME public.flights_id_seq
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1
);
	 
CREATE TABLE public.users (
    id bigint NOT NULL,
    email character varying(255),
    first_name character varying(255),
    last_name character varying(255),
    password character varying(255),
    role character varying(255)
);

ALTER TABLE public.users ALTER COLUMN id ADD GENERATED BY DEFAULT AS IDENTITY (
    SEQUENCE NAME public.users_id_seq
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1
);

